###############################################################################
def get_symops(sg, cell_choice=None):
    """
    get symmetry ops for a given space group

    Arguments:
    ----------
    * sg: space group symbol (string)
    * cell_choice:  cell choice if multiple options (string)

    Returns:
    --------
    * list of symmetry ops
    """
    sg = sg.replace(' ','').replace(':','')
    found = False
    for num, spgs in SPACEGROUPS.items():
        if sg in spgs: 
            found = True
            break
    if found is False: return None
    if cell_choice is not None:
        num = num + ':' + cell_choice
    symms = SPGRP_SYMM.get(num)
    if symms is None: return None
    symops = list(symms.values())[-1]
    ret = []
    for op in symops:
        ret.append(",".join(op))
    return ret

